import React from "react";
import purple from "@material-ui/core/colors/purple";
import red from "@material-ui/core/colors/red";
import pink from "@material-ui/core/colors/pink";

import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>material ui</h1>
      </header>
    </div>
  );
}

export default App;
